query:
mutation containerFqdnRemoveValues ( $accountId:ID! $fqdnContainerRemoveValuesInput:FqdnContainerRemoveValuesInput!) {
	container ( accountId:$accountId ) {
		fqdn {
			removeValues ( input:$fqdnContainerRemoveValuesInput   ) {
				container {
					id
					name
					description
					size
					audit {
						createdBy
						lastModifiedBy
						lastModifiedAt
						createdAt
					}
				}
			}
		}
	}	
}
